APP.factory("TPL",[function(){return{content:'\n<div class="angularData">\n    <div class="button" ng-click="getData()">Get Data from Server Angular</div>\n    <div id="serverDataAngular">{{angularData}} <br /> <br /> {{newData}}</div>\n</div>\n<div class="testData">\n    <div>\n        <label>First Name:</label>\n        <input type="text" ng-model="angularData[0].first" />\n    </div>\n    <div>\n        <label>Last Name:</label>\n        <input type="text" ng-model="angularData[0].last" />\n    </div>\n    <div>\n        <label>Sport:</label>\n        <input type="text" ng-model="angularData[0].sport" />\n    </div>\n    <div>\n        <div class="button" ng-click="deleteData(angularData[0].id)">Delete</div>\n        <div class="button" ng-click="updateData(angularData[0].id, angularData[0].first, angularData[0].last, angularData[0].sport)">Save</div>\n    </div>\n    <div>\n        <label>First Name:</label>\n        <input type="text" ng-model="angularData[1].first" />\n    </div>\n    <div>\n        <label>Last Name:</label>\n        <input type="text" ng-model="angularData[1].last" />\n    </div>\n    <div>\n        <label>Sport:</label>\n        <input type="text" ng-model="angularData[1].sport" />\n    </div>\n    <div>\n        <div class="button" ng-click="deleteData(angularData[1].id)">Delete</div>\n        <!--<div class="button" ng-click="updateData(angularData[0].id)">Save</div>\n        -->\n    </div>\n    <div>\n        <label>First Name:</label>\n        <input type="text" ng-model="angularData[2].first" />\n    </div>\n    <div>\n        <label>Last Name:</label>\n        <input type="text" ng-model="angularData[2].last" />\n    </div>\n    <div>\n        <label>Sport:</label>\n        <input type="text" ng-model="angularData[2].sport" />\n    </div>\n    <div>\n        <div class="button" ng-click="deleteData(angularData[2].id)">Delete</div>\n        <!--<div class="button" ng-click="updateData(angularData[0].id)">Save</div>\n        -->\n    </div>\n</div>\n<div class="testData">\n    <div>\n        <label>First Name:</label>\n        <input type="text" ng-model="first" />\n    </div>\n    <div>\n        <label>Last Name:</label>\n        <input type="text" ng-model="last" />\n    </div>\n    <div>\n        <label>Sport:</label>\n        <input type="text" ng-model="sport" />\n    </div>\n    <div class="button" ng-click="insertData(first, last, sport)">Add</div>\n</div>\n\n<!--Div that will hold the pie chart-->\n<div id="chart_div" style="width:500; height:400"> first chart here</div>\n<div id="chart_div2" style="width:500; height:400"> second chart here</div>\n<div id="chart_div3" style="width:500; height:400"> third chart here</div>\n'}}]);